    const key=process.env.REACT_APP_FINNHUB_API_KEY
    const base_url=process.env.REACT_APP_FINNHUB_BASE_URL
    const currentPrices=[]
    for(let symbol of symbols){
        const response =await fetch(`${base_url}symbol=${symbol}&token=${key}`)
        const result=await response.json()
        currentPrices.push({'symbol':symbol,'current_price':result.c})
    }
    return currentPrices
}
